import React, { Component } from "react";

class Food extends Component {
  render() {
    return (
      <div
        id="carouselExampleIndicators"
        className="carousel side"
        data-ride="carousel"
      >
        <ol className="carousel-indicators">
          <li
            data-target="#carouselExampleIndicators"
            data-slided-to="0"
            className="active"
          />
        </ol>
      </div>
    );
  }
}
export default Food;
